  @override
  String get faqAboutDeveloperBody1 =>
      'EHW+ എന്നതിലുള്ള നിങ്ങളുടെ താൽപ്പര്യത്തിന് നന്ദി. 2020 ഡിസംബറിൽ ടിമോ ബഹർ എന്ന ഞാനാണ് EHW+ പുറത്തിറക്കിയത്. ഞാൻ ഒരു മുഴുവൻ സമയ ആപ്പ് ഡെവലപ്പറാണ്, പരിസ്ഥിതി സംരക്ഷണത്തിന് സംഭാവന നൽകുന്നതിനായി എൻ്റെ ഒഴിവുസമയങ്ങളിൽ EHW+ ൽ പ്രവർത്തിക്കുന്നു. 2022 മെയ് മുതൽ, രണ്ടാമത്തെ ഡവലപ്പർ എൻ്റെ ജോലിക്ക് മേൽനോട്ടം വഹിക്കുന്നു, തോമസ് ഹെസ്സെ EHW+ നായി ബാക്ക്എൻഡുകൾ നിർമ്മിക്കുന്നു. 2023 ഏപ്രിൽ മുതൽ, ജനിൻ സിന്നർ നിരവധി ഉപഭോക്തൃ ഫീഡ്‌ബാക്കുകൾ കൈകാര്യം ചെയ്യുന്നു. 2024 ജൂലൈ മുതൽ, ആർടെം യുഷാക്കോവ് ഒരു ആപ്പ് ഡെവലപ്പറായി ചേർന്നു.';

