  @override
  String privacyBlock3aText(String appNameShort) {
    return 'ഞങ്ങൾ $appNameShort സൃഷ്‌ടിച്ചതിനാൽ നിങ്ങളുടെ മീറ്റർ റീഡിംഗുകൾ വേഗത്തിലും എളുപ്പത്തിലും നൽകാനും തുടർന്ന് നിങ്ങളുടെ ഉപഭോഗത്തെക്കുറിച്ചും അതിൻ്റെ ചെലവുകളെക്കുറിച്ചും സാധ്യതയുള്ള സമ്പാദ്യങ്ങളെക്കുറിച്ചും കൂടുതലറിയാൻ സ്ഥിതിവിവരക്കണക്കുകൾ ഉപയോഗിക്കാനും കഴിയും. $appNameShort-ൽ ഞങ്ങൾ പൊതുവെ \'ഉള്ളടക്കം\' എന്ന് വിളിക്കുന്ന ഏത് ഡാറ്റയും നിങ്ങൾക്ക് നൽകാനോ കണക്കാക്കാനോ സംരക്ഷിക്കാനോ കഴിയുമെന്നാണ് ഇതിനർത്ഥം. ഈ ഡാറ്റ നിങ്ങളുടെ മൊബൈൽ ഫോണിൽ മാത്രമേ സംഭരിക്കപ്പെടുകയുള്ളൂ.\n\nGoogle ഡ്രൈവുമായി സമന്വയിപ്പിക്കുക.\nനിങ്ങൾ Google ഡ്രൈവുമായി സമന്വയം പ്രാപ്‌തമാക്കുകയാണെങ്കിൽ, നിങ്ങളുടെ Google ഡ്രൈവിലെ \'$appNameShort\' എന്ന ഫോൾഡറിൽ ഉള്ളടക്കം സ്വയമേവ ബാക്കപ്പ് ചെയ്യപ്പെടും, അത് നിങ്ങൾക്ക് മാത്രം ആക്‌സസ് ചെയ്യാൻ കഴിയും. Google-ൽ ലോഗിൻ ചെയ്യുന്നതിലൂടെ, നിങ്ങളുടെ ഇമെയിൽ വിലാസം ഡെവലപ്പർക്ക് ദൃശ്യമാകും.';
  }

  @override
  String privacyBlock3bText(String googleApiAgreement) {
    return '$googleApiAgreement\n\nലൊക്കേഷൻ ഡാറ്റ.\nഉപയോക്തൃ പെരുമാറ്റം മനസിലാക്കുന്നതിനും ഭാവിയിലെ സവിശേഷതകൾക്കുമായി, ആപ്പ് അജ്ഞാത ഉപയോഗ ഡാറ്റ കൈമാറുന്നു.\nമൂന്നാം കക്ഷികളുമായി ഡാറ്റ പങ്കിടില്ല.\nഉത്ഭവം (രാജ്യവും നഗരവും), ഭാഷ, ഓപ്പറേറ്റിംഗ് സിസ്റ്റം, ഉപകരണത്തിൻ്റെ തരം, മിഴിവ്, ക്ലിക്ക് പെരുമാറ്റം, ഉപയോഗ കാലയളവ് എന്നിവയെക്കുറിച്ചുള്ള വിവരങ്ങൾ ശേഖരിക്കാം.\n\nഉപകരണ ഡാറ്റ.\nസേവനത്തിലേക്ക് കണക്റ്റുചെയ്യാൻ നിങ്ങൾ ഉപയോഗിക്കുന്ന ഉപകരണങ്ങളുടെ എണ്ണത്തെയും തരത്തെയും കുറിച്ചുള്ള ഡാറ്റയും ആ ഉപകരണങ്ങളിലെ ഓപ്പറേറ്റിംഗ് സിസ്റ്റത്തെക്കുറിച്ചുള്ള വിവരങ്ങളും ഞങ്ങൾ ശേഖരിക്കുന്നു (ഉദാ. Android, iOS, Windows അല്ലെങ്കിൽ macOS).\n\nആപ്പ് ഉപയോഗിക്കുന്നതിലൂടെ, മുകളിൽ വിവരിച്ചതുപോലെ അജ്ഞാത ഡാറ്റയുടെ ശേഖരണത്തിന് നിങ്ങൾ സമ്മതം നൽകുന്നു.';
  }

