      'ബാധകമായ ഡാറ്റാ സംരക്ഷണ നിയമം, നിങ്ങളുടെ സ്വകാര്യ ഡാറ്റയുടെ പ്രോസസ്സിംഗുമായി ബന്ധപ്പെട്ട് കൺട്രോളറുമായി ബന്ധപ്പെട്ട് ഒരു ഡാറ്റ വിഷയമായി (വിവരങ്ങളുടെയും ഇടപെടലുകളുടെയും അവകാശങ്ങൾ) സമഗ്രമായ അവകാശങ്ങൾ നിങ്ങൾക്ക് നൽകുന്നു, അത് ഞങ്ങൾ നിങ്ങളെ താഴെ അറിയിക്കും:\n\n- കലയ്ക്ക് അനുസൃതമായി വിവരാവകാശം. 15 GDPR: പ്രത്യേകിച്ചും, ഞങ്ങൾ പ്രോസസ്സ് ചെയ്ത നിങ്ങളുടെ സ്വകാര്യ ഡാറ്റ, പ്രോസസ്സിംഗ് ഉദ്ദേശ്യങ്ങൾ, പ്രോസസ്സ് ചെയ്ത വ്യക്തിഗത ഡാറ്റയുടെ വിഭാഗങ്ങൾ, നിങ്ങളുടെ ഡാറ്റ വെളിപ്പെടുത്തിയിട്ടുള്ള സ്വീകർത്താക്കൾ അല്ലെങ്കിൽ സ്വീകർത്താക്കളുടെ വിഭാഗങ്ങൾ, ആസൂത്രിത സംഭരണ കാലയളവ് അല്ലെങ്കിൽ സംഭരണ കാലയളവ് നിർണ്ണയിക്കുന്നതിനുള്ള മാനദണ്ഡം, ഒബ്ജക്റ്റ് പ്രോസസ്സ്, പരിമിതപ്പെടുത്തൽ, പരിമിതപ്പെടുത്താനുള്ള അവകാശം എന്നിവയെക്കുറിച്ചുള്ള വിവരങ്ങൾ നേടാനുള്ള അവകാശം നിങ്ങൾക്കുണ്ട്. ഒരു സൂപ്പർവൈസറി അതോറിറ്റിക്ക് പരാതി, അത് നിങ്ങളിൽ നിന്ന് ഞങ്ങൾ ശേഖരിച്ചിട്ടില്ലെങ്കിൽ നിങ്ങളുടെ ഡാറ്റയുടെ ഉത്ഭവം, പ്രൊഫൈലിംഗ് ഉൾപ്പെടെയുള്ള സ്വയമേവയുള്ള തീരുമാനമെടുക്കൽ, കൂടാതെ, ബാധകമാകുന്നിടത്ത്, ഉൾപ്പെട്ടിരിക്കുന്ന ലോജിക്കിനെക്കുറിച്ചുള്ള അർത്ഥവത്തായ വിവരങ്ങൾ, നിങ്ങൾക്കായി അത്തരം പ്രോസസ്സിംഗിൻ്റെ പ്രാധാന്യവും വിഭാവനം ചെയ്ത അനന്തരഫലങ്ങളും, അതുപോലെ തന്നെ കലയിൽ നിലനിൽക്കുന്ന ഉറപ്പുകളെക്കുറിച്ച് അറിയിക്കാനുള്ള നിങ്ങളുടെ അവകാശവും. 46 നിങ്ങളുടെ ഡാറ്റ മൂന്നാം രാജ്യങ്ങളിലേക്ക് കൈമാറുമ്പോൾ GDPR;\n\n- കലയ്ക്ക് അനുസൃതമായി തിരുത്താനുള്ള അവകാശം. 16 GDPR: നിങ്ങളെ സംബന്ധിച്ച കൃത്യമല്ലാത്ത ഡാറ്റ കാലതാമസമില്ലാതെ തിരുത്താനും കൂടാതെ/അല്ലെങ്കിൽ ഞങ്ങൾ സംഭരിച്ച അപൂർണ്ണമായ ഡാറ്റ പൂർത്തിയാക്കാനും നിങ്ങൾക്ക് അവകാശമുണ്ട്.\n\n- കലയ്ക്ക് അനുസൃതമായി മായ്‌ക്കാനുള്ള അവകാശം. 17 GDPR: കലയുടെ വ്യവസ്ഥകൾ ഉണ്ടെങ്കിൽ നിങ്ങളുടെ സ്വകാര്യ ഡാറ്റ മായ്ക്കാൻ അഭ്യർത്ഥിക്കാൻ നിങ്ങൾക്ക് അവകാശമുണ്ട്. 17(1) GDPR പാലിക്കപ്പെടുന്നു. എന്നിരുന്നാലും, അഭിപ്രായസ്വാതന്ത്ര്യത്തിനും വിവരത്തിനുമുള്ള അവകാശം വിനിയോഗിക്കുന്നതിനും നിയമപരമായ ബാധ്യതകൾ പാലിക്കുന്നതിനും പൊതുതാൽപ്പര്യം അല്ലെങ്കിൽ നിയമപരമായ ക്ലെയിമുകൾ സ്ഥാപിക്കുന്നതിനും പ്രയോഗിക്കുന്നതിനും പ്രതിരോധിക്കുന്നതിനും പ്രോസസ്സിംഗ് ആവശ്യമാണെങ്കിൽ ഈ അവകാശം പ്രത്യേകിച്ചും ബാധകമല്ല.\n\n- കലയ്ക്ക് അനുസൃതമായി പ്രോസസ്സിംഗ് നിയന്ത്രിക്കാനുള്ള അവകാശം. 18 GDPR: അസ്വീകാര്യമായ ഡാറ്റാ പ്രോസസ്സിംഗിൻ്റെ അടിസ്ഥാനത്തിൽ നിങ്ങളുടെ ഡാറ്റ മായ്‌ക്കുന്നതിനെ നിങ്ങൾ എതിർത്തിട്ടുണ്ടെങ്കിൽ, നിങ്ങളുടെ ഡാറ്റയുടെ കൃത്യത പരിശോധിക്കപ്പെടുന്നിടത്തോളം കാലം നിങ്ങളുടെ സ്വകാര്യ ഡാറ്റയുടെ പ്രോസസ്സിംഗ് നിയന്ത്രിക്കാൻ അഭ്യർത്ഥിക്കാൻ നിങ്ങൾക്ക് അവകാശമുണ്ട്, പകരം നിങ്ങളുടെ ഡാറ്റ പ്രോസസ്സ് ചെയ്യുന്നതിന് നിയന്ത്രണം അഭ്യർത്ഥിക്കുക ശേഖരിച്ചത്, അല്ലെങ്കിൽ നിങ്ങളുടെ പ്രത്യേക സാഹചര്യവുമായി ബന്ധപ്പെട്ട് നിങ്ങൾ ഒരു എതിർപ്പ് രേഖപ്പെടുത്തിയിട്ടുണ്ടെങ്കിൽ, ഞങ്ങളുടെ ന്യായമായ കാരണങ്ങൾ നിലനിൽക്കുന്നുണ്ടോ എന്ന് ഇതുവരെ വ്യക്തമല്ല;\n\n- കലയുടെ അടിസ്ഥാനത്തിൽ അറിയിക്കാനുള്ള അവകാശം. 19 GDPR: കൺട്രോളറുമായി ബന്ധപ്പെട്ട് തിരുത്തൽ, മായ്‌ക്കൽ അല്ലെങ്കിൽ പ്രോസസ്സിംഗ് പരിമിതപ്പെടുത്തൽ എന്നിവയ്‌ക്കുള്ള നിങ്ങളുടെ അവകാശം നിങ്ങൾ വിനിയോഗിച്ചിട്ടുണ്ടെങ്കിൽ, നിങ്ങളുടെ സ്വകാര്യ ഡാറ്റ ഈ തിരുത്തൽ അല്ലെങ്കിൽ മായ്ക്കൽ അല്ലെങ്കിൽ പ്രോസസ്സിംഗ് പരിമിതപ്പെടുത്തൽ എന്നിവയെക്കുറിച്ച് വെളിപ്പെടുത്തിയ എല്ലാ സ്വീകർത്താക്കളെയും അറിയിക്കാൻ കൺട്രോളർ ബാധ്യസ്ഥനാണ്. ഈ സ്വീകർത്താക്കളെ കുറിച്ച് അറിയിക്കാൻ നിങ്ങൾക്ക് അവകാശമുണ്ട്.\n\n- കലയ്ക്ക് അനുസൃതമായി ഡാറ്റ പോർട്ടബിലിറ്റിക്കുള്ള അവകാശം. 20 GDPR: ഘടനാപരമായതും സാധാരണയായി ഉപയോഗിക്കുന്നതും മെഷീൻ റീഡുചെയ്യാനാകുന്നതുമായ ഫോർമാറ്റിൽ നിങ്ങൾ ഞങ്ങൾക്ക് നൽകിയ നിങ്ങളുടെ സ്വകാര്യ ഡാറ്റ സ്വീകരിക്കുന്നതിനോ സാങ്കേതികമായി സാധ്യമാകുന്ന മറ്റൊരു കൺട്രോളറിലേക്ക് മാറ്റാൻ അഭ്യർത്ഥിക്കുന്നതിനോ നിങ്ങൾക്ക് അവകാശമുണ്ട്.\n\n- കലയ്ക്ക് അനുസൃതമായി അനുവദിച്ച സമ്മതം പിൻവലിക്കാനുള്ള അവകാശം. 7(3) GDPR: ഭാവിയിൽ പ്രാബല്യത്തിൽ വരുമ്പോൾ ഏത് സമയത്തും ഡാറ്റ പ്രോസസ്സ് ചെയ്യുന്നതിനുള്ള നിങ്ങളുടെ സമ്മതം പിൻവലിക്കാൻ നിങ്ങൾക്ക് അവകാശമുണ്ട്. പിൻവലിക്കൽ സാഹചര്യത്തിൽ, സമ്മതമില്ലാതെ പ്രോസസ് ചെയ്യുന്നതിനുള്ള നിയമപരമായ അടിസ്ഥാനത്തെ അടിസ്ഥാനമാക്കി കൂടുതൽ പ്രോസസ്സിംഗ് നടത്താൻ കഴിയുന്നില്ലെങ്കിൽ, ബന്ധപ്പെട്ട ഡാറ്റ ഞങ്ങൾ കാലതാമസമില്ലാതെ ഇല്ലാതാക്കും. സമ്മതം പിൻവലിക്കൽ, അത് പിൻവലിക്കുന്നതിന് മുമ്പുള്ള സമ്മതത്തെ അടിസ്ഥാനമാക്കിയുള്ള പ്രോസസ്സിംഗിൻ്റെ നിയമസാധുതയെ ബാധിക്കില്ല.\n\n- കലയ്ക്ക് അനുസൃതമായി പരാതി നൽകാനുള്ള അവകാശം. 77 GDPR: നിങ്ങളുടെ സ്വകാര്യ ഡാറ്റയുടെ പ്രോസസ്സിംഗ് GDPR ലംഘിക്കുന്നതായി നിങ്ങൾ വിശ്വസിക്കുന്നുവെങ്കിൽ, ഒരു സൂപ്പർവൈസറി അതോറിറ്റിക്ക്, പ്രത്യേകിച്ച് നിങ്ങളുടെ താമസസ്ഥലം, നിങ്ങളുടെ ജോലിസ്ഥലം അല്ലെങ്കിൽ ആരോപണവിധേയമായ ലംഘനം നടന്ന സ്ഥലം എന്നിവയിൽ, മറ്റേതെങ്കിലും ഭരണപരമായ അല്ലെങ്കിൽ ജുഡീഷ്യൽ പ്രതിവിധികളോട് മുൻവിധികളില്ലാതെ പരാതി നൽകാൻ നിങ്ങൾക്ക് അവകാശമുണ്ട്.';

